window.bookSummaryJSON = "<p>\"McDonald has a wonderful sense of how eight-year-olds think and behave, and the irrepressible Judy is completely believable.” (<i>Booklist</i>) </p> <p>“Established fans and new readers will enjoy this adventure. Amusing black-and-white watercolors capture the humor and the girl’s inimitable spirit. <i>Prediction</i>: another winner starring Judy Moody.” (<i>School Library Journal</i>) </p> <p>“Judy Moody Predicts the Future is the famously temperamental third-grader’s fourth adventure.... Here Judy, equipped with a mood ring, convinces herself and her classmates of her clairvoyant capabilities.” (<i>Publishers Weekly</i>)</p>"; 
